import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import 'materialize-css'
import { Card, Row } from 'react-materialize'

class Menu extends Component {
  onLogoutClick = (e) => {
    e.preventDefault()
    this.props.logoutUser()
  }

  render() {
    return (
      <div>
        <Link to="/camera">
          <Row>
            <Card style={{ width: '50%' }}>
              <h1>Camera</h1>
            </Card>
          </Row>
        </Link>
      </div>
    )
  }
}

export default Menu
